// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// import "./TransferService.sol";
error ErrorValue(string,uint256);
contract Test {
    address payable myAddress;
    function setAddress(address payable _address) public {
        myAddress = _address;
    }
    function test (uint256 _bounty) public  payable returns(bool){
        uint256 _payMoney = getPercentage(_bounty, 70);
            if (msg.value < _payMoney) {
                revert ErrorValue("error : Incorrect value", _payMoney);
            }
            return true;
    }
    function getPercentage(uint256 _number, uint256 _ratio)
        public
        pure
        returns (uint256 returnNumber)
    {
        returnNumber = (_number* _ratio) / 100;
    }
}

